import React, { Component } from 'react';
import TaskFinishItem from './../Components/TaskFinishItem';
import TaskFinishItemAdmin from './../Components/TaskFinishItemAdmin'
class TaskFinishList extends Component {
    render() {
        return (

                 <div className="panel panel-success">
                  <div className="panel-heading">
                    <h3 className="panel-title">Task Finish</h3></div>
                  <div className="panel-body">
                   <TaskFinishItem/>
                   <TaskFinishItemAdmin/>
                  </div>
                </div>
        );
    }
}

export default TaskFinishList;
